import React from 'react';

const DashboardPage = () => {
  return (
    <div>
      <h1>Bảng điều khiển</h1>
      <p>Đây là nơi hiển thị các thông tin tổng quan của hệ thống.</p>
    </div>
  );
};

export default DashboardPage;
